import React, { Component } from 'react';
class SearchBox extends Component {
    render() { 
        return (  
            <div className="d-block">
                <p className="h1 text-center"> Find thousands court documents</p>
                <form className="card-body row no-gutters align-items-center">
                        <input class="" type="search" placeholder="Search topics or keywords" />
                        <button class="btn btn-lg btn-success mt-0" type="submit">Search</button>
                </form>
            </div>
        );
    }
}
 
export default SearchBox;
